import React from "react";
import './Header.css';

const Header = () => {
  return (
    <header>
      <div className="navbar">
                <h1>READIFY</h1>
                <nav>
                <button><a href="/">Home</a></button>
                <button><a href="/booklist">Book List</a></button>
                <button><a href="/additems">Add Items</a></button>
                <button><a href="/profile">Profile</a></button>
                </nav>
            </div>
    </header>
  );
};

export default Header;
